import { useState } from "react";
import * as S from "./styles";

export default function Home() {
  const [isOpenPopUp, setIsOpenPopUp] = useState(false);

  function onOpenPopUp() {
    setIsOpenPopUp(!isOpenPopUp);
  }
  return (
    <S.Container>
      <h1>"Copia e Colar"</h1>

      <ul>
        <Link to={"/"} className="nav-link">
          <li>Bottoes</li>
        </Link>
        <li>Inputs</li>
        <li>Efeito click</li>
        <li>Navegaçao</li>
        <li>Usar Theme</li>
        <li>Animaçoes</li>
        <li>Outros</li>
      </ul>
    </S.Container>
  );
}
